def insert_request_log(result, condition, url):
    platform = get_common_config('request_info', 'platform')
    task_id = get_common_config('request_info', 'task_id')
    user_id = get_common_config('request_info', 'user_id')
    ip = str(get_ip_address()).replace('.', '')
    if result is None:
        request_log = RequestLog(platform, task_id, user_id, condition, url, ip, None)
    else:
        # result_dict = json.loads(result)
        job_result = (result.get('resultbody', {}).get('job', None))
        source_data = json.dumps(job_result)
        request_log = RequestLog(platform, task_id, user_id, condition, url, ip, source_data)
    RequestLogRepository().insert(request_log)


